full_reasoning:
Step-by-step reasoning:
1. Psychological mechanisms:
 • Responders care about how much money they receive (monetary payoff).
 • They also care about fairness relative to their contribution, where fairness is judged by the proportion of tokens contributed compared to the total tokens (self vs. opponent).
 • Research on inequity aversion in the responder role suggests that responders are especially sensitive to receiving less than what they perceive as their fair share.
2. Interactions:
 • The “fair share” is computed as the proportion of one’s tokens relative to total tokens multiplied by the combined earning.
 • If the offered share (split_self) is below the fair share, a penalty is incurred; if it equals or exceeds the fair share, no fairness penalty is applied.
3. Mathematical form:
 • We use a linear combination of the monetary reward scaled by a gain sensitivity parameter (delta) and subtract a fairness penalty scaled by an inequity aversion parameter (lambda) when disadvantageous inequity occurs.
 • Mathematically, the fairness norm is: FairShare = (token_self / (token_self + token_opp)) * combined_earning.
 • The penalty is: lambda * max(FairShare − split_self, 0).
4. Learnable parameters:
 • delta (gain sensitivity): scales the importance of the monetary outcome.
 • lambda (inequity aversion): quantifies sensitivity to receiving less than one’s fair share.
 • Both parameters have generous finite bounds.
5. Mapping to observable behavior:
 • The model uses the observed monetary outcome (split_self), the tokens (token_self, token_opp), and the combined earnings (combined_earning) to compute the utility of accepting an offer.
 • The computed utility (U_accept) then serves as input to a choice function (with temperature handled externally) such that lower (or negative) utilities represent less attractive responder behavior.

The formal model is provided below.

<MODEL>
U_accept = delta * split_self - lambda * max((token_self / (token_self + token_opp)) * combined_earning - split_self, 0)
</MODEL>

